import React from "react";
import {Row, Col} from "reactstrap";

const Table = props => {
    const getRow1 = _ => {
        let chairs = [];
        for (var i = 0; i < Math.ceil(props.chairs / 2); i++) {
          chairs.push(
            <span
              key={i}
              className={props.empty ? "empty-table" : "full-table"}
            ></span>
          );
        }
        return chairs;
      };
      const getRow2 = _ => {
        let chairs2 = [];
        for (var i = 0; i < Math.floor(props.chairs / 2); i++) {
          chairs2.push(
            <span
              key={i}
              className={props.empty ? "empty-table" : "full-table"}
            ></span>
          );
        }
        return chairs2;
      };
    return(
        <div>
        <p>Table Page</p>
        </div>
    )
}

export default Table;
